export class Token {
  constructor(key, idAuthor) {
    this._key = key;
    this._idAuthor = idAuthor;
  }
  get key() {
    return this._key;
  }
  get idAuthor() {
    return this._idAuthor;
  }
  set key(key) {
    this._key = key;
  }
  set idAuthor(idAuthor) {
    this._idAuthor = idAuthor;
  }
}
